import React from "react";

import Login from './Login';
import CreateAccount from './CreateAccount';
import Main from './Main';
import { 
  BrowserRouter as Router, 
  Route, 
  Link, 
  NavLink, 
  Switch 
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/">
              <Login />
          </Route>
          <Route path="/login">
              <Login />
          </Route>
          <Route path="/createaccount">
              <CreateAccount />
          </Route>
          <Route path="/main/:id?">
              <Main />
          </Route>
        </Switch>
      </div>
    </Router>
  )
}

export default App;
